            <Navbare/>
            <h3>A propos</h3>
            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Exercitationem nulla incidunt nobis dolorum nesciunt laborum iusto sapiente ullam at quae! Qui quasi corporis, ipsam excepturi ad repellendus quibusdam quam ducimus!</p>
        </div>
    );
};

export default About;
